import React from 'react'
import './main.css'
import { useNavigate } from 'react-router-dom';

function Main() {
    const navigate = useNavigate();
    const handleLogout = (event) => {
        localStorage.setItem("isSigned", "false");
        localStorage.setItem("isauthorized", "");
        navigate("/");
      };
  return (
    <div>
       <nav class="navbar navbar-expand-lg navbar-dark bg-primary">
  <div class="container-fluid">
    <label class="navbar-brand" href="#">Navbar</label>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav me-auto mb-2 mb-lg-0">
        <li class="nav-item">
          <button class="nav-link" href="#">Home</button>
        </li>
        <li class="nav-item">
          <button class="nav-link" href="#">Link</button>
        </li>
      </ul>
      <form class="d-flex">
      <button class="custom-btn btn-3" value="Log Out" onClick={handleLogout}><span>Log Out</span></button>
      </form>
    </div>
  </div>
</nav>
<div class="progress">
  <div class="progress-bar" role="progressbar" style={{width :'25%'}} aria-valuenow="75" aria-valuemin="0" aria-valuemax="100">25%</div>
</div>
</div>
  )
}

export default Main
